import mail from '../Assets/mail.png';
function App() {
    return (
      <div className="App w-[100vw] h-[45vh] flex items-center flex-col gap-[1vh] justify-center  overflow-y-auto bordertest">
            <div className='w-full h-[25vh] bordertest footerdesc flex justify-center items-center'>
                <div className='w-[25vw] h-full bordertest flex flex-col justify-center items-center gap-[0.5vw]'>
                    <img src={mail}></img>
                    <p className='footerindex'>Mail</p>
                    <p className='footerindexdec'>Mail</p>
                </div>
                <div className='w-[25vw] h-full bordertest'></div>
                <div className='w-[25vw] h-full bordertest'></div>
            </div>
            <div className='w-full h-[5vh] bordertest footerdesc'></div>
            <div className='w-full h-[15vh] bordertest footerdesc'></div>
      </div>
    );
  }
  
export default App;
